function SearchItems(props) {
  const { input1, setInput1, input2, setInput2, handleSubmit, tuitionState, setTuitionState } = props;

  const handleInputChange = (e) => {
    if (e.target.name === "input1") {
      setInput1(e.target.value);
    } else if (e.target.name === "input2") {
      setInput2(e.target.value);
    }
  };

  const handleRadioChange = (e) => {
    setTuitionState(e.target.value);
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        College:
        <input type="text" name="input1" value={input1} onChange={handleInputChange} />
      </label>
      <label>
        Major:
        <input type="text" name="input2" value={input2} onChange={handleInputChange} />
      </label>
      <label>
        In State:
        <input type="radio" name="tuition" value="In State" checked={tuitionState === "In State"} onChange={handleRadioChange} />
      </label>
      <label>
        Out of State:
        <input type="radio" name="tuition" value="Out of State" checked={tuitionState === "Out of State"} onChange={handleRadioChange} />
      </label>
      <button type="submit">Submit</button>
    </form>
  );
}

const handleSubmit = (e) => {
  e.preventDefault();
  const { input1, input2 } = e.target.elements;
  props.onSubmit({
    input1: input1.value,
    input2: input2.value
  });
  input1.value = "";
  input2.value = "";
};
